(78, 51, 'en', 'product', 'description', '<p>\n	Children''s warmed boots - the best option for outdoor activities in nature.<br />\n	<br />\n	&nbsp;\n</p>\n\n<ul>\n	<li>\n		<strong>HEAT CONSERVATION</strong>\n\n		<p>\n			Artificial fur inside the shoe perfectly protects against cold.<br />\n			<br />\n			&nbsp;\n		</p>\n	</li>\n	<li>\n		<strong>EASE</strong>\n		<p>\n			Lightweight upholstery materials and soles provide low weight of shoes and comfort.<br />\n			<br />\n			&nbsp;\n		</p>\n	</li>\n	<li>\n		<strong>PROTECTION FROM MUD</strong>\n		<p>\n			Kalosha made of light EVA material reliably protects against moisture and dirt.<br />\n			<br />\n			&nbsp;\n		</p>\n	</li>\n	<li>\n		<strong>UNIQUE DESIGN</strong>\n		<p>\n			A bright design with Minnie Mouse from Disney will certainly have a child''s liking.<br />\n			&nbsp;\n		</p>\n	</li>\n</ul>\n'),
