(285, 32, 'en', 'product', 'description', '<p>\n	&nbsp;\n</p>\n\n<p>\n	A bright baseball cap in sports style from Demix from the Russian Team line for sports fans and fans of the Russian team. A high-quality material with high ventilation properties ensures excellent air permeability and lightness.\n</p>\n'),
