(407, 48, 'en', 'product', 'title', ' Sneakers Nike Air Force'),
(408, 48, 'en', 'product', 'description', '<ul>\n	<li>\n		<p>\n			<b>POWERFUL, PROPULSIVE FEEL</b>\n		</p>\n\n		<p>\n			A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>\n		</p>\n\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>LIGHTWEIGHT SUPPORT</b>\n		</p>\n\n		<p>\n			A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.\n		</p>\n	</li>\n</ul>\n\n<p>\n	<b>MORE DETAILS</b>\n</p>\n\n<ul>\n	<li>\n		Reinforced rubber heel for lasting durability\n	</li>\n	<li>\n		Offset: 10mm\n	</li>\n	<li>\n		Weight: 8.75 ounces (men''s size 10)\n	</li>\n</ul>\n'),
(427, 47, 'en', 'product', 'description', '<ul>\n	<li>\n		<p>\n			<b>POWERFUL, PROPULSIVE FEEL</b>\n		</p>\n\n		<p>\n			A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>\n		</p>\n\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>LIGHTWEIGHT SUPPORT</b>\n		</p>\n\n		<p>\n			A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.\n		</p>\n	</li>\n</ul>\n\n<p>\n	<b>MORE DETAILS</b>\n</p>\n\n<ul>\n	<li>\n		Reinforced rubber heel for lasting durability\n	</li>\n	<li>\n		Offset: 10mm\n	</li>\n	<li>\n		Weight: 8.75 ounces (men''s size 10)\n	</li>\n</ul>\n'),
(430, 47, 'en', 'product', 'meta_desc', 'POWERFUL, PROPULSIVE FEEL A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals'),
(447, 41, 'en', 'product', 'description', '<h3>\n	<strong>ADVANTAGES</strong>\n</h3>\n&nbsp;\n\n<ul>\n	<li>\n		<p>\n			Lightning in the heel allows you to easily take off and put on a model\n		</p>\n	</li>\n	<li>\n		<p>\n			Lightweight, flexible and breathable Flyknit material\n		</p>\n	</li>\n	<li>\n		Foam sole with Nike Air cushioning insert for ease and comfort Durable rubber protector for traction\n	</li>\n</ul>\n\n<p>\n	<br />\n	<br />\n	&nbsp;\n</p>\n\n<h3 data-fulltext=\"\" data-placeholder=\"Перевод\" dir=\"ltr\" id=\"tw-target-text\">\n	<br />\n	<strong>THE ORIGINS OF FLYKNIT</strong>\n</h3>\n\n<div dir=\"ltr\">\n	&nbsp;\n</div>\n\n<p data-fulltext=\"\" data-placeholder=\"Перевод\" dir=\"ltr\">\n	When creating the technology Nike Flyknit experts relied on the requests of athletes to create shoes that would not be practically felt on the leg and would sit like a second skin. The team of programmers, engineers and designers Nike for 4 years developed a technology that will increase the wear resistance of the fabric for the top sneakers and allow it to stay in shape longer. They managed to bring the development to perfection, taking into account all the requirements for support, elasticity and air permeability. The result of the work was a super lightweight and almost seamless top fabric, which ensures optimal fit.\n</p>\n'),
(450, 41, 'en', 'product', 'meta_desc', 'POWERFUL, PROPULSIVE FEEL A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals'),
(482, 46, 'en', 'product', 'title', 'Skechers Pureflex-Prima Ballet-X'),
(483, 46, 'en', 'product', 'description', '<ul>\n	<li>\n		<p>\n			<b>POWERFUL, PROPULSIVE FEEL</b>\n		</p>\n\n		<p>\n			A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals.<br />\n			&nbsp;\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>\n		</p>\n\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort.<br />\n			&nbsp;\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>LIGHTWEIGHT SUPPORT</b>\n		</p>\n\n		<p>\n			A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.\n		</p>\n	</li>\n</ul>\n'),
(486, 46, 'en', 'product', 'meta_desc', 'КОМФОРТ Смягчающая стелькаMemory Foamповторяет форму стопы. СВОБОДА ДВИЖЕНИЙ Подошва из прочной и легкой резины, устойчивой к многократному изгибу.'),
(538, 42, 'en', 'product', 'title', ' Nike Air Versitile'),
(539, 42, 'en', 'product', 'description', '<ul>\n	<li>\n		<p>\n			<b>POWERFUL, PROPULSIVE FEEL</b>\n		</p>\n\n		<p>\n			A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>\n		</p>\n\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort.\n		</p>\n	</li>\n	<li>\n		<p>\n			<b>LIGHTWEIGHT SUPPORT</b>\n		</p>\n\n		<p>\n			A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.\n		</p>\n	</li>\n</ul>\n'),
(542, 42, 'en', 'product', 'meta_desc', 'СТАБИЛИЗАЦИЯ И ПОДДЕРЖКА СТОПЫ Мягкие выступы на бортике гарантируют комфорт и предотвращают проскальзывание стопы. ФИКСАЦИЯ Интегрированная ленточная шнуровка надежно фиксирует обувь на стопе во время резких рывков'),
(557, 40, 'en', 'product', 'title', 'Case Demix+'),
(558, 40, 'en', 'product', 'description', '<strong>Demix </strong>- a great example of the embodiment of the American dream. The company, which began with the desire of the student to find a decent sports shoes, has become one of the strongest brands in the world, which significantly influenced the development of sports and viral marketing. In addition, it was Demix that made sports not only a great sight, but also a profitable business.'),
(561, 40, 'en', 'product', 'meta_desc', 'Удобный чехол для смартфона крепится на руку и позволяет во время тренировки оставаться на связи, пользоваться приложениями для более эффективных занятий и слушать музыку'),
(584, 38, 'en', 'product', 'description', '&nbsp;\n<ul>\n	<li>\n		<b>POWERFUL, PROPULSIVE FEEL</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\n		&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;\n		<p>\n			&nbsp;A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals. &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;\n		</p>\n		&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;\n	</li>\n	<li>\n		<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\n		&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort. &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;\n		</p>\n		&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;\n	</li>\n	<li>\n		<b>LIGHTWEIGHT SUPPORT</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\n		&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\n		A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n		<br />\n		&nbsp;&nbsp; &nbsp;\n	</li>\n</ul>\n'),
