(620, 33, 'en', 'product', 'description', '<ul>\n	<li>\n		<p>\n			<b>POWERFUL, PROPULSIVE FEEL</b>\n		</p>\n\n		<p>\n			A full-length carbon-infused nylon plate within the midsole feels like it propels you forward with every step, so you''re just that much closer to your goals.\n		</p>\n		<br />\n		&nbsp;\n	</li>\n	<li>\n		<p>\n			<b>SMOOTH, RESPONSIVE&nbsp;RIDE</b>\n		</p>\n\n		<p>\n			Lunarlon cushioning combines soft and firm foam for a balance of shock absorption, stability and response, without sacrificing comfort.\n		</p>\n		<br />\n		&nbsp;\n	</li>\n	<li>\n		<p>\n			<b>LIGHTWEIGHT SUPPORT</b>\n		</p>\n\n		<p>\n			A nearly seamless one-piece Flymesh upper is designed to be more breathable through the top of your foot to help keep it cool as your run heats up. Ultra-light Flywire cables hug your foot the more you tighten your laces, providing a secure fit that moves with you.\n		</p>\n		<br />\n		&nbsp;\n	</li>\n</ul>\n'),
