(1334, 62, 'en', 'product', 'description', 'The iPhone X is the first iPhone to have a 5.8-inch screen with ultraslim bezels. The first to use an OLED screen, a different technology than the typical LCD panels, which Apple says will make colors absolutely&nbsp;<em>pop</em>. The first iPhone to completely do away with Apple''s iconic home button, a mainstay since the very first iPhone.&nbsp;Face ID&nbsp;gives it a new way to securely unlock the phone and pay with your face (Apple has no more use for your fingerprints). Finally, the iPhone X is Apple''s only new device to nab a portrait mode on the front-facing camera (despite having just one lens and not two), optical image stabilization for both rear 12-megapixel camera lenses&nbsp;<em>and</em>&nbsp;-- more breezily -- a new feature to animate poop.&nbsp;'),
