(10262, 98, 'en', 'product', 'description', 'The 3D Touch technology offers stunning new features - just one click. And the function of Live Photos allows you to literally revive your memories. And this is only the beginning. Take a closer look at the iPhone 6s and you will see innovations at all levels. The 12 megapixel iSight camera makes sharp and detailed shots, and also allows you to shoot stunning 4K video with a resolution almost four times that of HD 1080p video. A 5-megapixel HD-camera FaceTime allows you to make excellent selfies. In addition, now you have the opportunity to shoot Live Photos, which literally bring back the most precious memories. This function records a few moments before and after taking a picture, which allows you to watch it in motion, with one click. iPhone 6s Plus is equipped with a specially designed A9 processor with 64-bit architecture. Now its performance reaches the level that only desktop computers demonstrated earlier. The speed of the iPhone 6s processor is up to 70% higher than that of the previous generation, and the graphics processor is 90% faster, providing instant response in resource-intensive applications and games.'),
