(11078, 100, 'en', 'product', 'description', 'The most popular camera is improved. Installed the most intelligent and powerful processor ever created for the iPhone. Without wires, the charging process becomes elementary. A supplemented reality opens up unprecedented opportunities so far. iPhone 8. <strong>A new generation of iPhone</strong>.<br />\n<br />\n<strong>The case is completely made of glass</strong><br />\nSuch a durable glass on both sides of the iPhone has not yet been. The frame in the tone of the body is made of aluminum, used in the aerospace industry.<br />\n<br />\n<strong>Protection against water and dust</strong><br />\nThanks to a well-thought-out engineering solution, the case of iPhone 8 is perfectly protected from water, spray and dust.<br />\n<br />\n<strong>Brand new display</strong><br />\nThe image on the display Retina HD has become even more accurate and beautiful. The new display supports advanced color gamut, True Tone and 3D Touch technologies.<br />\n<br />\n<strong>True Tone</strong><br />\nTrue Tone technology automatically adjusts the white balance with light. To please the eye in any case.<br />\n<br />\n<strong>Gorgeous Colors</strong><br />\nOn the display with the expanded color coverage and the improved color rendition, the photos look even brighter and more saturated.<br />\n<br />\n<strong>Wide viewing angle</strong><br />\nThanks to the two-domain pixels on the display you can watch from almost any angle.<br />\n<br />\n<strong>A completely new matrix</strong><br />\nA new 12 MP camera with an enlarged and faster matrix. New color filter. Deeper pixels. Optical image stabilization for photos and video.<br />\n<br />\n<strong>Portrait Mode</strong><br />\nThe \"Portrait\" mode on the iPhone 8 Plus is even better. Now the objects in the foreground are even sharper, the blurring of the background is more natural.<br />\n<br />\n<strong>Portrait lighting</strong><br />\nWith a dual camera and a new point system for determining the outlines of the face in Portrait mode, impressive effects of studio lighting are now available.<br />\n<br />\n<strong>Optical zoom</strong><br />\nWide-angle and telephoto lens on the iPhone 8 Plus support both optical and digital zoom with magnification up to 10 times when taking pictures and up to 6 times with video.<br />\n<br />\n<strong>A faster processor</strong><br />\nIntroducing A11 Bionic. Four cores, responsible for efficiency, work up to 70% faster than in the A10 Fusion processor.<br />\nAnd two more cores, responsible for performance, - up to 25% faster.<br />\n<br />\n<strong>Energy Efficiency</strong><br />\nThe second generation performance controller provides additional power when it is needed. Thus the charge of the accumulator is spent sparingly.<br />\n<br />\n<strong>Apple''s graphics processor</strong><br />\nThe new 3-core graphics processor runs up to 30% faster than the A10 Fusion.<br />\n<br />\n<strong>Augmented Reality</strong><br />\nThe A11 Bionic processor offers incredible game and application capabilities with augmented reality. This you have not seen before.<br />\n<br />\n<strong>iOS</strong><br />\niOS is the most advanced, intuitive and secure mobile operating system in the world. With it you have all the capabilities of the iPhone.<br />\n<br />\n<strong>What''s new in iOS 11</strong><br />\nFaster access to the desired applications from the Messages. Individual setting of the control point.'),
