"INSERT INTO `".$prefix."product` (`id`, `sort`, `cat_id`, `title`, `description`, `price`, `url`, `image_url`, `code`, `count`, `activity`, `meta_title`, `meta_keywords`, `meta_desc`, `old_price`, `recommend`, `new`, `related`, `inside_cat`, `1c_id`, `weight`, `link_electro`, `currency_iso`, `price_course`, `image_title`, `image_alt`, `yml_sales_notes`, `count_buy`, `system_set`, `related_cat`, `short_description`, `last_updated`, `unit`) VALUES
(62, 62, 1, 'Apple iPhone X', '<p>	Совершенно новый дисплей Super&nbsp;Retina с&nbsp;диагональю 5,8&nbsp;дюйма, который удобно лежит в&nbsp;руке и&nbsp;потрясающе выглядит,&nbsp;— это и&nbsp;есть iPhone&nbsp;X.</p>', 141999, 'apple-iphone-x', 'ix1.jpg|ix2.jpg', 'SKU219', 12, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 141999, '|', '|prodtmpimg/ix2.jpg', NULL, NULL, 1, '', '<p>	<strong>iPhone </strong>одним большим дисплеем. Настолько впечатляющим дисплеем, чтобы&nbsp;вы&nbsp;забывали о&nbsp;самом физическом устройстве. И&nbsp;настолько умным устройством, чтобы оно реагировало на&nbsp;прикосновение, слово и&nbsp;даже взгляд.&nbsp;</p>', '2017-10-16 14:40:38', ''),
(53, 53, 2, 'Кеды для мальчиков Demix Fancy', '<ul>	<li>		<b>КОМФОРТ</b><br />		Подкладка выполнена из натурального хлопка.	</li>	<li>		<b>УНИКАЛЬНЫЙ ДИЗАЙН</b><br />		Яркий дизайн с любимыми героями мульфильма \"Тачки\"&nbsp;от Disney доставит детям огромное удовольствие.	</li>	<li>		<b>НАДЕЖНАЯ ФИКСАЦИЯ</b><br />		Застежки на липучках позволяют равномерно затягивать и надежно фиксировать обувь на ноге.	</li></ul>', 2999, 'shoes-for-boys-demix-fancy', '11683880299.jpg|11683890299.jpg', 'SKU225', -1, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 2999, '|', '|prodtmpimg/11683890299.jpg', NULL, NULL, 1, '', '&nbsp;Непревзойдённое сочетание цены и качества говорят сами за себя, что значительно упрощает решение при выборе товара.', '2017-10-16 14:40:38', ''),
(52, 52, 2, 'Шлепанцы для мальчиков Joss Bimbo', '<p>	Яркие и легкие детские шлепанцы станут отличным вариантом для занятий плаванием.<br />	<br />	&nbsp;</p><ul>	<li>		<b>ЛЕГКОСТЬ</b><br />		Модель выполнена из легкого и гибкого материала ЭВА.<br />		&nbsp;	</li>	<li>		<b>НАДЕЖНАЯ ФИКСАЦИЯ</b><br />		Плотная резинка и застежки-липучки гарантируют, что сандалии будут крепко держаться на ноге.	</li></ul>', 1199, 'shlepantsy-dlya-malchikov-joss-bimbo', '13176420299.jpg|131764202990.jpg|131764202991.jpg', 'SKU233', -1, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 1199, '||', '|prodtmpimg/131764202990.jpg|prodtmpimg/131764202991.jpg', NULL, NULL, 1, '', 'Яркие и легкие детские шлепанцы станут отличным вариантом для занятий плаванием.', '2017-10-16 14:40:38', ''),
(51, 51, 2, 'Сапоги утепленные Outventure Willy', '<p>	Детские утепленные сапоги - оптимальный вариант для активного отдыха на природе.<br />	&nbsp;</p><ul>	<li>		<b>СОХРАНЕНИЕ ТЕПЛА</b><br />		Искусственный мех внутри обуви отлично защищает от холода.	</li>	<li>		<b>ЛЕГКОСТЬ</b><br />		Легкие материалы верха и подошвы обеспечивают низкий вес обуви и комфорт.	</li>	<li>		<b>ЗАЩИТА ОТ ГРЯЗИ</b><br />		Калоша из легкого материала ЭВА надежно защищает от влаги и грязи.	</li>	<li>		<b>УНИКАЛЬНЫЙ ДИЗАЙН</b><br />		Яркий дизайн с Минни Маус от Disney непременно придется ребенку по душе.	</li></ul>', 2599, 'sapogi-uteplennye-outventure-willy', '13140250299.jpg|13140540299.jpg', 'SKU241', 70, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 2599, '|', '|prodtmpimg/13140540299.jpg', NULL, NULL, 1, '', 'Детские утепленные сапоги - оптимальный вариант для активного отдыха на природе.', '2017-10-16 14:40:38', ''),
(49, 49, 2, 'Сапоги утепленные для девочек Outventure Arctic', '<ul>	<li>		<b>СОХРАНЕНИЕ ТЕПЛА</b><br />		<br />		Синтетический мех внутри обуви надежно защитит от холода.<br />		<br />		&nbsp;	</li>	<li>		<b>БЫСТРАЯ ШНУРОВКА</b><br />		<br />		Модель быстро и легко шнуруется при помощи эластичного шнурка и пластикового фиксатора.	</li></ul>', 8999, 'sapogi-uteplennye-dlya-devochek-outventure-arcticsapogi-uteplennye-dlya-malchikov-outventure-willy', '13615870299.jpg|13615870298.jpg', 'SKU257', 60, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 8999, '|', 'prodtmpimg/13615870299.jpg|', NULL, NULL, 1, '', '<p>	Детские сапоги с верхом из искусственной кожи отлично подойдут для путешествий и долгих прогулок.<br />	&nbsp;</p>', '2017-10-16 14:40:38', ''),
(48, 48, 3, 'Кеды женские Nike Air Force', '<ul>	<li>		<b>АМОРТИЗАЦИЯ</b><br />		Специальная стелька-вкладыш&nbsp;RISE FIT&nbsp;эффективно поглощает ударные нагрузки.	</li></ul><ul>	<li>		<b>СЦЕПЛЕНИЕ С ПОВЕРХНОСТЬЮ</b><br />		Высококачественная резина подошвы обеспечивает надежное сцепление с поверхностью.	</li></ul>', 6799, 'kedy-jenskie-skechers', 'nike-air-force-1-ultra-flyknit-university-red_uedaoa.jpg|nike-wmns-air-force-1-flyknit-818018-800-30.jpg', 'SKU273', 50, 1, '', '', '', '0', 0, 1, '', '', '', 0, '', 'RUR', 6799, '|', '|prodtmpimg/nike-wmns-air-force-1-flyknit-818018-800-30.jpg', NULL, NULL, 1, '', '<p>	&nbsp;Непревзойдённое сочетание цены и качества говорят сами за себя, что значительно упрощает решение при выборе товара.</p>', '2017-10-17 07:23:46', ''),
