(108, 108, 16, 'Куртка пуховая мужская Outventure 3000', '<ul>	<li>		<strong><span>СОХРАНЕНИЕ ТЕПЛА</span></strong>		<p>			Модель выполнена из теплого флиса.		</p>	</li>	<li>		<strong><span>СВОБОДА ДВИЖЕНИЙ</span></strong>		<p>			Продуманный крой не стесняет движений, обеспечивая дополнительный комфорт во время активного отдыха.		</p>	</li>	<li>		<strong><span>УДОБСТВО</span></strong>		<p>			Молния до середины груди позволяет заправлять джемпер в брюки.		</p>	</li>	<li>		<strong><span>ПРАКТИЧНОСТЬ</span></strong>		<p>			Для хранения небольших предметов предусмотрены вместительные карманы.		</p>	</li></ul>', 3799, 'kurtka-puhovaya-mujskaya-outventure-3000', '155.jpg|156.jpg', 'SKU157', 30, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 3799, '|', '|prodtmpimg/156.jpg', '', NULL, 1, '', '<strong>Outventure</strong>. Ощути свободу движения.', '2017-10-16 14:40:38', ''),
(102, 102, 4, 'Кроссовки  Nike Air Huarache', '<ul>	<li>		<b>СТАБИЛИЗАЦИЯ И ПОДДЕРЖКА СТОПЫ</b><br />		Мягкие выступы на бортике гарантируют комфорт и предотвращают проскальзывание стопы.	</li>	<li>		<b>ФИКСАЦИЯ</b><br />		Интегрированная ленточная шнуровка надежно фиксирует обувь на стопе во время резких рывков.	</li>	<li>		<b>АМОРТИЗАЦИЯ</b><br />		Вставка Air-Sole в области пятки обеспечивает амортизацию во время жестких приземлений.	</li>	<li>		<b>СЦЕПЛЕНИЕ С ПОВЕРХНОСТЬЮ</b><br />		Универсальная и долговечная подметка отлично подходит для разных поверхностей.	</li>	<li>		<b>ВЕНТИЛЯЦИЯ</b><br />		Легкий воздухопроницаемый верх из сетки.	</li></ul>', 6299, 'nike-air-versitile_102', 'ssssUntitled-1.jpg|sssUntitled-1.jpg', 'SKU171', 20, 1, '', '', '', '0', 0, 1, '', '', '', 0, '', 'RUR', 6299, '|', '|prodtmpimg/sssUntitled-1.jpg', '', NULL, 1, '', '<p>	Ваша цель ближе, чем Вы думаете.</p>', '2017-10-17 07:23:35', ''),
(42, 42, 4, 'Кроссовки Nike Air Versitile', '<ul>	<li>		<b>СТАБИЛИЗАЦИЯ И ПОДДЕРЖКА СТОПЫ</b><br />		Мягкие выступы на бортике гарантируют комфорт и предотвращают проскальзывание стопы.	</li>	<li>		<b>ФИКСАЦИЯ</b><br />		Интегрированная ленточная шнуровка надежно фиксирует обувь на стопе во время резких рывков.	</li>	<li>		<b>АМОРТИЗАЦИЯ</b><br />		Вставка Air-Sole в области пятки обеспечивает амортизацию во время жестких приземлений.	</li>	<li>		<b>СЦЕПЛЕНИЕ С ПОВЕРХНОСТЬЮ</b><br />		Универсальная и долговечная подметка отлично подходит для разных поверхностей.	</li>	<li>		<b>ВЕНТИЛЯЦИЯ</b><br />		Легкий воздухопроницаемый верх из сетки.	</li></ul>', 6299, 'nike-air-versitile', '9ed756896992eab045ad1dfa14ae47d3_zoom.jpg|TB16_VNRVXXXXbEXFXXsTjS8VXX_032829.jpg', 'SKU307', 60, 1, '', '', '', '0', 0, 1, '', '', '', 0, '', 'RUR', 6299, '|', '|prodtmpimg/TB16_VNRVXXXXbEXFXXsTjS8VXX_032829.jpg', NULL, NULL, 1, '', '<p>	Nike. Ощути свободу движения.</p>', '2017-10-17 07:23:33', ''),
(41, 41, 4, 'Кроссовки Nike Flight Bonafide', '<h3>	&nbsp;</h3><h3>	<b>ПРЕИМУЩЕСТВА</b></h3>&nbsp;<ul>	<li>		Молния в области пятки позволяет легко снимать и надевать модель	</li>	<li>		Легкий, эластичный и воздухопроницаемый материал Flyknit	</li>	<li>		Подошва из пеноматериала с амортизирующей вставкой Nike Air для легкости и комфорта	</li>	<li>		Прочный резиновый протектор для сцепления	</li></ul>&nbsp;<h3>	<b>ИСТОКИ FLYKNIT</b></h3><br />При создании технологии Nike Flyknit специалисты опирались на просьбы атлетов создать обувь, которая бы практически не ощущалась на ноге и сидела словно вторая кожа. Команда программистов, инженеров и дизайнеров Nike в течение 4 лет разрабатывали технологию, которая позволит повысить износостойкость ткани для верха кроссовок и позволит ей дольше сохранять форму. Им удалось довести разработку до совершенства с учетом всех требований к поддержке, эластичности и воздухопроницаемости. Результатом работы стала суперлегкая и практически бесшовная ткань верха, обеспечивающая оптимальное прилегание. Кроме того, невероятно точная технология производства повышает функциональность и сокращает количество отходов в среднем на 60% по сравнению с классическим методом, позволяя сохранить сотни тонн материалов.', 7999, 'krossovki-mujskie-demix-prime', 'Untitled-1.jpg|Nike-Flight-Bonafide-Black-White.jpg|Nike-Flight-Bonafide-Pure-Platinum.jpg|Nike-Flight-Bonafide.jpg', 'SKU319', 80, 1, 'Кроссовки Nike Flight Bonafide', 'Кроссовки Nike Flight Bonafide купить, SKU319, Кроссовки, Nike, Flight, Bonafide', '', '0', 0, 1, '', '', '', 0, '', 'RUR', 7999, '|||', 'prodtmpimg/Untitled-1.jpg|prodtmpimg/Nike-Flight-Bonafide-Black-White.jpg|prodtmpimg/Nike-Flight-Bonafide-Pure-Platinum.jpg|prodtmpimg/Nike-Flight-Bonafide.jpg', NULL, NULL, 1, '', '<p>	Мужские кроссовки Nike Flight Bonafide, вдохновленные классической баскетбольной моделью.<br />	&nbsp;</p>', '2017-10-17 07:26:44', ''),
(40, 40, 6, 'Чехол на руку для смартфона Demix+', 'Удобный чехол для смартфона крепится на руку и позволяет во время тренировки оставаться на связи, пользоваться приложениями для более эффективных занятий и слушать музыку. Влагоотводящая сетка на задней части и легкая в обращении система регулировки размера сделает занятия спортом еще комфортнее и приятнее.', 499, 'chehol-na-ruku-dlya-smartfona-demix', '40Untitled-1.jpg|41Untitled-1.jpg|42Untitled-1.jpg', 'SKU343', 168, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 499, '||', '|prodtmpimg/41Untitled-1.jpg|prodtmpimg/42Untitled-1.jpg', NULL, NULL, 1, '', '<p>	<strong>Demix.</strong> Ощути свободу движения.</p>', '2017-10-16 14:40:38', ''),
(38, 38, 6, 'Чехол на руку Nike Distance 2.0 для смартфона', '<p>	Особенности модели:</p><ul>	<li>		благодаря эластичному материалу, чехол плотно прилегает к руке;	</li>	<li>		бесшовная конструкция обеспечивает комфорт во время пробежки;	</li>	<li>		прозрачная пленка защищает экран от царапин и позволяет использовать телефон, не доставая его из чехла;	</li>	<li>		предусмотрен выход для наушников;	</li>	<li>		удобная и надежная застежка при необходимости регулируется по ширине.	</li></ul>', 2199, 'chehol-na-ruku-nike-distance-2-0-dlya-smartfona', '11.jpg|10.jpg', 'SKU346', 50, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 2199, '|', 'prodtmpimg/11.jpg|prodtmpimg/testpng.png', NULL, NULL, 1, '', '<p>	&nbsp;Непревзойдённое сочетание цены и качества говорят сами за себя, что значительно упрощает решение при выборе товара.</p>', '2017-10-16 14:40:38', ''),
(37, 37, 6, 'Чехол для iPhone', '&nbsp;<ul>	<li>		прозрачная пленка защищает экран от царапин и позволяет использовать телефоны с сенсорными экранами, не доставая их из чехла;	</li>	<li>		предусмотрен выход для наушников;	</li>	<li>		светоотражающий логотип бренда сделает вас заметнее в темное время суток.	</li></ul>', 599, 'chehol-dlya-iphone', '20.jpg', 'SKU348', 34, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 599, '', '', NULL, NULL, 1, '', '<p>	<br />	&nbsp;Unrivaled combination of price and quality speak for themselves, which greatly simplifies the decision when choosing a product.</p>', '2017-10-16 14:40:38', ''),
