(124, 124, 12, 'Часы G-Shock GA-100A-12ER', '<h2>	#MYGSHOCK</h2><br />Покажите свою модель G-SHOCK и станьте частью сообщества G-SHOCK. Как это сделать: сфотографируйте ваши часы G-SHOCK и загрузите фотографию на нашу&nbsp;официальную страницу в Facebook. В качестве альтернативы вы можете воспользоваться Instagram, опубликовав свою фотографию G-SHOCK с хэштегом #myGSHOCK. Если вам немного повезет, ваша фотография G-SHOCK вскоре появится на нашей «стене» в социальных сетях.', 10999, 'chasy-g-shock-ga-100a-12er', '1004.jpg|1001.jpg|1002.jpg|1003.jpg|1000.jpg', 'SKU64', 50, 1, '', '', '', '12999', 0, 0, '', '', '', 0, '', 'RUR', 10999, '||||', '||||', '', NULL, 1, '', 'Покажите свою модель G-SHOCK и станьте частью <strong>сообщества G-SHOCK</strong>.&nbsp;', '2017-10-16 14:40:38', 'шт.'),
(107, 107, 7, 'Фитнес-трекер Xiaomi', '<ul>	<li>		<b>МОНИТОРИНГ АКТИВНОСТИ</b><br />		Анализ распорядка дня для здоровья и энергии.	</li>	<li>		<b>МОНИТОРИНГ СНА И УМНЫЙ БУДИЛЬНИК</b><br />		Фитнес-трекер ONETRAK Life 01 учитывает продолжительность сна и анализирует его фазы, чтобы помочь рассчитать время для полного восстановления сил. Умный будильник выберет оптимальное время для пробуждения.	</li>	<li>		<b>ПОСТАНОВКА ЦЕЛЕЙ И ВОДНЫЙ БАЛАНС</b><br />		Пополните список достижений маленькими ежедневными победами. Установите норму по количеству воды и следите за ее выполнением. Соблюдать водный баланс с ONETRAK Life 01 легко!	</li></ul>', 2399, 'fitnes-treker-xiaomi', '1-1.jpg|1-2.jpg|1-3.jpg', 'SKU165', 12, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 2399, '||', '|prodtmpimg/1-2.jpg|prodtmpimg/1-3.jpg', '', NULL, 1, '', '<p>	&nbsp;Непревзойдённое сочетание цены и качества говорят сами за себя, что значительно упрощает решение при выборе товара.</p>', '2017-10-16 14:40:38', ''),
