(114, 114, 18, 'Леггинсы Rock', '<h2>	Легинсы для фитнеса</h2>Яркие, стильные легинсы для фитнеса – это удобная одежда для занятий любыми видами спорта. Изготавливаемые из мягких эластичных тканей высокого качества, эти обтягивающие штаны отлично подходят для спортивного зала. Они мягко облегают ноги и бедра, не сковывая движений во время тренировки. Для занятий фитнесом или pole dance лучше всего подходят бесшовные модели, изготавливаемые из гигроскопичных тканей, которые эффективно впитывают влагу и хорошо пропускают воздух, позволяя коже дышать и обеспечивая свободный влаго- и теплообмен.&nbsp;', 5999, 'legginsy-rockcode', 'Untitled-11.jpg|Untitled-10.jpg|Untitled-12.jpg', 'SKU106', 45, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 5999, '||', 'prodtmpimg/Untitled-11.jpg|prodtmpimg/13.jpeg|prodtmpimg/Untitled-12.jpg', NULL, NULL, 1, '', 'Этот удобный, практичный предмет одежды является одним из самых модных трендов текущего сезона.', '2017-10-17 07:23:59', 'шт.'),
(115, 115, 18, 'Леггинсы Miracle', '<h2>	Легинсы для фитнеса</h2>Яркие, стильные легинсы для фитнеса – это удобная одежда для занятий любыми видами спорта. Изготавливаемые из мягких эластичных тканей высокого качества, эти обтягивающие штаны отлично подходят для спортивного зала. Они мягко облегают ноги и бедра, не сковывая движений во время тренировки. Для занятий фитнесом или pole dance лучше всего подходят бесшовные модели, изготавливаемые из гигроскопичных тканей, которые эффективно впитывают влагу и хорошо пропускают воздух, позволяя коже дышать и обеспечивая свободный влаго- и теплообмен.&nbsp;', 6999, 'legginsy-miracle', '100.jpg|101.jpg|102.jpg|103.jpg|104.jpg', 'SKU103', 60, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 6999, '||||', '|prodtmpimg/101.jpg|prodtmpimg/102.jpg|prodtmpimg/103.jpg|prodtmpimg/104.jpg', '', NULL, 1, '', 'Этот удобный, практичный предмет одежды является одним из самых модных трендов текущего сезона.', '2017-10-17 07:24:00', 'шт.'),
(116, 116, 18, 'Леггинсы Magic', '<h2>	Легинсы для фитнеса</h2>Яркие, стильные легинсы для фитнеса – это удобная одежда для занятий любыми видами спорта. Изготавливаемые из мягких эластичных тканей высокого качества, эти обтягивающие штаны отлично подходят для спортивного зала. Они мягко облегают ноги и бедра, не сковывая движений во время тренировки. Для занятий фитнесом или pole dance лучше всего подходят бесшовные модели, изготавливаемые из гигроскопичных тканей, которые эффективно впитывают влагу и хорошо пропускают воздух, позволяя коже дышать и обеспечивая свободный влаго- и теплообмен.&nbsp;', 7999, 'legginsy-magic', '1201.jpg|1202.jpg|1203.jpg|1204.jpg|1200.jpg', 'SKU100', 40, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 7999, '||||', 'prodtmpimg/15079053939103_-_time_-_1201.jpg|prodtmpimg/1202.jpg|prodtmpimg/1203.jpg|prodtmpimg/1204.jpg|prodtmpimg/204.jpg', '', NULL, 1, '', 'Этот удобный, практичный предмет одежды является одним из самых модных трендов текущего сезона.', '2017-10-17 07:24:02', 'шт.'),
(106, 106, 7, 'Фитнес-трекер Onetrak Life 03', '<ul>	<li>		<b>МОНИТОРИНГ АКТИВНОСТИ</b><br />		Анализ распорядка дня для здоровья и энергии.	</li>	<li>		<b>МОНИТОРИНГ СНА И УМНЫЙ БУДИЛЬНИК</b><br />		Фитнес-трекер ONETRAK Life 01 учитывает продолжительность сна и анализирует его фазы, чтобы помочь рассчитать время для полного восстановления сил. Умный будильник выберет оптимальное время для пробуждения.	</li>	<li>		<b>ПОСТАНОВКА ЦЕЛЕЙ И ВОДНЫЙ БАЛАНС</b><br />		Пополните список достижений маленькими ежедневными победами. Установите норму по количеству воды и следите за ее выполнением. Соблюдать водный баланс с ONETRAK Life 01 легко!	</li></ul>', 5199, 'fitnes-treker-onetrak-life-03', '130.jpg|131.jpg', 'SKU166', 60, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 5199, '|', '|prodtmpimg/131.jpg', '', NULL, 1, '', '<p>	Ваша цель ближе, чем Вы думаете.</p>', '2017-10-16 14:40:38', ''),
(120, 120, 12, 'Часы G-Shock GA-100-1A2ER', '<h2>	#MYGSHOCK</h2><br />Покажите свою модель G-SHOCK и станьте частью сообщества G-SHOCK. Как это сделать: сфотографируйте ваши часы G-SHOCK и загрузите фотографию на нашу&nbsp;официальную страницу в Facebook. В качестве альтернативы вы можете воспользоваться Instagram, опубликовав свою фотографию G-SHOCK с хэштегом #myGSHOCK. Если вам немного повезет, ваша фотография G-SHOCK вскоре появится на нашей «стене» в социальных сетях.', 10999, 'chasy-g-shock-ga-100-1a2er', '1000.jpg|1001.jpg|1002.jpg|1003.jpg|1004.jpg', 'SKU84', 30, 1, '', '', '', '12999', 0, 0, '', '', '', 0, '', 'RUR', 10999, '||||', '|prodtmpimg/1001.jpg|prodtmpimg/1002.jpg|prodtmpimg/1003.jpg|prodtmpimg/1004.jpg', NULL, NULL, 1, '', 'Покажите свою модель G-SHOCK и станьте частью <strong>сообщества G-SHOCK</strong>.&nbsp;', '2017-10-16 14:40:38', 'шт.'),
(117, 117, 11, 'ТОП AFRICAN TATOO BERSERK', '<h2>	Топ для фитнеса</h2>Топ для фитнеса принадлежит к спортивной одежде, рассчитанной на среднюю нагрузку. Оставляя живот открытым, большинство моделей плотно обтягивают грудь, одновременно поддерживая и подчеркивая ее. Поскольку топ для фитнеса не должен смещаться даже при самых резких движениях, он обязательно фиксируется на теле с помощью широкой эластичной резинки. Наиболее популярны классические модели топа для фитнеса, снабженные широкими или средними лямками и круглым вырезом. Фитнес-топы нужно подбирать строго по размеру.&nbsp;', 3599, 'top-african-tatoo-berserk', '500.jpg|501.jpg|503.jpg|504.jpg', 'SKU96', 50, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 3599, '|||', '|prodtmpimg/501.jpg|prodtmpimg/503.jpg|prodtmpimg/504.jpg', NULL, NULL, 1, '', 'Больше. Во всех проявлениях.<br />&nbsp;', '2017-10-16 14:40:38', ''),
