(4, 4, 16, 'Куртка пуховая мужская Outventure', '<ul>	<li>		<strong><span>СОХРАНЕНИЕ ТЕПЛА</span></strong>		<p>			Модель выполнена из теплого флиса.		</p>	</li>	<li>		<strong><span>СВОБОДА ДВИЖЕНИЙ</span></strong>		<p>			Продуманный крой не стесняет движений, обеспечивая дополнительный комфорт во время активного отдыха.		</p>	</li>	<li>		<strong><span>УДОБСТВО</span></strong>		<p>			Молния до середины груди позволяет заправлять джемпер в брюки.		</p>	</li>	<li>		<strong><span>ПРАКТИЧНОСТЬ</span></strong>		<p>			Для хранения небольших предметов предусмотрены вместительные карманы.		</p>	</li></ul>', 3799, 'kurtka-puhovaya-mujskaya-outventure', '150.jpg|151.jpg', 'SKU371', 393, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 3799, '|', '|prodtmpimg/151.jpg', NULL, NULL, 1, '', '&nbsp;Непревзойдённое сочетание цены и качества говорят сами за себя, что значительно упрощает решение при выборе товара.', '2017-10-16 14:40:38', ''),
