"INSERT INTO `".$prefix."product` (`id`, `sort`, `cat_id`, `title`, `description`, `price`, `url`, `image_url`, `code`, `count`, `activity`, `meta_title`, `meta_keywords`, `meta_desc`, `old_price`, `recommend`, `new`, `related`, `inside_cat`, `1c_id`, `weight`, `link_electro`, `currency_iso`, `price_course`, `image_title`, `image_alt`, `yml_sales_notes`, `count_buy`, `system_set`, `related_cat`, `short_description`, `last_updated`, `unit`) VALUES
(100, 100, 1, 'Apple iPhone 8', '<p>	Совершенно новый дизайн, в&nbsp;котором передняя и&nbsp;задняя панели iPhone выполнены из&nbsp;стекла. Самая популярная камера усовершенствована. Установлен самый умный и&nbsp;мощный процессор, когда-либо созданный для iPhone. Без проводов процесс зарядки становится элементарным. А&nbsp;дополненная реальность открывает невиданные до&nbsp;сих пор возможности. iPhone 8. Новое поколение iPhone.</p><p>	<b>Корпус полностью из&nbsp;стекла</b><br />	Такого прочного стекла с&nbsp;обеих сторон у&nbsp;iPhone ещё не&nbsp;было. Рамка в&nbsp;тон корпусу выполнена из&nbsp;алюминия, применяемого в&nbsp;аэрокосмической отрасли.</p><p>	<b>Защита от&nbsp;воды и&nbsp;пыли</b><br />	Благодаря продуманному инженерному решению корпус iPhone 8&nbsp;отлично защищён от&nbsp;воды, брызг и&nbsp;пыли.</p><p>	<b>Совершенно новый дисплей</b><br />	Изображение на&nbsp;дисплее Retina HD&nbsp;стало ещё точнее и&nbsp;красивее. Новый дисплей поддерживает расширенный цветовой охват, технологии True Tone и&nbsp;3D&nbsp;Touch.</p><p>	<b>True Tone</b><br />	Технология True Tone автоматически настраивает баланс белого с&nbsp;учётом освещения. Чтобы радовать глаз в&nbsp;любом случае.</p><p>	<b>Великолепные цвета</b><br />	На&nbsp;дисплее с&nbsp;расширенным цветовым охватом и&nbsp;улучшенной цветопередачей фотографии выглядят ещё ярче и&nbsp;насыщеннее.</p><p>	<b>Широкий угол обзора</b><br />	Благодаря двухдоменным пикселям на&nbsp;дисплей можно смотреть практически под любым углом.</p><p>	<b>Совершенно новая матрица</b><br />	Новая камера 12&nbsp;Мп с&nbsp;увеличенной и&nbsp;более быстрой матрицей. Новый цветофильтр. Более глубокие пиксели. Оптическая стабилизация изображения для фото и&nbsp;видео.</p><p>	<b>Режим «Портрет»</b><br />	Режим «Портрет» на&nbsp;iPhone 8&nbsp;Plus стал ещё лучше. Теперь объекты на&nbsp;переднем плане ещё более чёткие, размытие фона&nbsp;— более естественное.</p><p>	<b>Портретное освещение</b><br />	С&nbsp;двойной камерой и&nbsp;новой точечной системой определения контуров лица в&nbsp;режиме «Портрет» теперь доступны впечатляющие эффекты студийного освещения.</p><p>	<b>Оптический зум</b><br />	Широкоугольный и&nbsp;телеобъектив на&nbsp;iPhone 8&nbsp;Plus поддерживают как оптический, так и&nbsp;цифровой зум с&nbsp;увеличением до&nbsp;10&nbsp;раз при фотосъёмке и&nbsp;до&nbsp;6&nbsp;раз при видеосъёмке.</p><p>	<b>Более быстрый процессор</b><br />	Представляем A11&nbsp;Bionic. Четыре ядра, отвечающие за&nbsp;эффективность, работают до&nbsp;70% быстрее, чем в&nbsp;процессоре A10&nbsp;Fusion.&nbsp;<br />	А&nbsp;ещё два ядра, отвечающие за&nbsp;производительность,&nbsp;— до&nbsp;25% быстрее.</p><p>	<b>Энергоэффективность</b><br />	Контроллер производительности второго поколения обеспечивает дополнительную мощность, когда она необходима. При этом заряд аккумулятора расходуется экономно.</p><p>	<b>Графический процессор Apple</b><br />	Новый 3-ядерный графический процессор работает до&nbsp;30% быстрее, чем A10&nbsp;Fusion.</p><p>	<b>Дополненная реальность</b><br />	Процессор A11 Bionic открывает невероятные возможности игр и&nbsp;приложений с&nbsp;дополненной реальностью. Такого вы&nbsp;ещё не&nbsp;видели.</p><p>	<b>iOS</b><br />	iOS&nbsp;— самая совершенная, интуитивно понятная и&nbsp;безопасная мобильная операционная система в&nbsp;мире. С&nbsp;ней вам доступны все возможности iPhone.</p><p>	<b>Что нового в&nbsp;iOS 11</b><br />	Более быстрый доступ к&nbsp;нужным приложениям из&nbsp;Сообщений. Индивидуальная настройка Пункта управления.</p>', 131999, 'apple-iphone-8', 'i74.jpg|i75.jpg', 'SKU181', 80, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 131999, '|', '|prodtmpimg/i75.jpg', '', NULL, 1, '', '<p>	Совершенно новый дизайн, в&nbsp;котором передняя и&nbsp;задняя панели iPhone выполнены из&nbsp;стекла.</p>', '2017-10-16 14:40:38', ''),
(99, 99, 1, 'Apple iPhone 7', '<p>	Притягательный глянцевый корпус скрывает в&nbsp;себе мощную начинку. Производительный процессор, революционная система камер, усовершенствованный дисплей Retina&nbsp;HD, увеличенные динамики, превосходная операционная система.&nbsp;128&nbsp;Гб хватит на&nbsp;все, что нужно для работы, творчества и&nbsp;развлечений.</p>', 86999, 'apple-iphone-7', 'i72.jpg|i7.jpg|i73.jpg|i74.jpg|i75.jpg', 'SKU187', 90, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 86999, '||||', 'prodtmpimg/i72.jpg||prodtmpimg/i73.jpg|prodtmpimg/i74.jpg|prodtmpimg/i75.jpg', '', NULL, 1, '', '<p>	<strong>Apple iPhone 7&nbsp;</strong> — космически стильный смартфон с&nbsp;невероятным потенциалом.</p>', '2017-10-16 14:40:38', ''),
(98, 98, 1, 'Apple iPhone 6s', '<p>	&nbsp;Технология 3D&nbsp;Touch открывает потрясающие новые возможности&nbsp;— достаточно одного нажатия. А&nbsp;функция Live Photos позволяет буквально оживить ваши воспоминания. И&nbsp;это только начало. Присмотритесь к&nbsp;iPhone 6s&nbsp;внимательнее, и&nbsp;вы&nbsp;увидите инновации на&nbsp;всех уровнях. 12-мегапиксельная камера iSight делает чёткие и&nbsp;детальные снимки, а&nbsp;также позволяет снимать потрясающие видео 4K&nbsp;с&nbsp;разрешением почти в&nbsp;четыре раза больше, чем в&nbsp;HD?видео 1080p. А&nbsp;5-мегапиксельная HD?камера FaceTime позволяет делать отличные селфи. Кроме того, теперь у&nbsp;вас есть возможность снимать Live Photos, на&nbsp;которых буквально оживают самые дорогие воспоминания. Эта функция записывает несколько мгновений до&nbsp;и&nbsp;после съёмки фотографии, что позволяет посмотреть её&nbsp;в&nbsp;движении, сделав одно нажатие. iPhone 6s&nbsp;Plus оснащён специально разработанным процессором A9&nbsp;с 64-битной архитектурой. Теперь его производительность достигает уровня, который раньше демонстрировали только настольные компьютеры. Скорость процессора iPhone 6s&nbsp;до&nbsp;70% выше, чем у&nbsp;моделей предыдущего поколения, а&nbsp;графический процессор работает на&nbsp;90% быстрее, обеспечивая мгновенный отклик в&nbsp;ресурсоёмких приложениях и&nbsp;играх.</p>', 38999, 'apple-iphone-6s', 'i6.jpg|i62.jpg|i63.jpg', 'SKU207', 20, 1, '', '', '', '0', 0, 0, '', '', '', 0, '', 'RUR', 38999, '||', '||', '', NULL, 1, '', '<p>	Едва начав пользоваться iPhone 6s&nbsp;Plus, вы&nbsp;сразу почувствуете, насколько всё изменилось</p>', '2017-10-16 14:40:38', ''),
(126, 126, 17, 'Свитшот Rockcode', 'Mark&nbsp;— великолепный пример воплощения американской мечты. Компания, начинавшаяся с желания студента найти достойную спортивную обувь, превратилась в один из сильнейших брендов мира, который существенно повлиял на развитие спорта и вирусного маркетинга. Кроме того, именно Mark сделала спорт не только великолепным зрелищем, но и прибыльным бизнесом.', 4999, 'svitshot-rockcode', 'information_items_768.jpg|203.jpg|a69b789f-239c-4a03-9515-fc61899e6933.jpg|200.jpg', 'SKU44', 50, 1, '', '', '', '0', 1, 0, '', '', '', 0, '', 'RUR', 4999, '|||', '|||prodtmpimg/15079031627392_-_time_-_200.jpg', '', NULL, 1, '', 'Ощути свободу движения.', '2017-10-16 14:40:38', '')",

